This Will Destroy You - Young Mountain

This Will Destroy You is an instrumental American post-rock band from San Marcos, Texas. The band is made up of Chris King, Raymond Brown, Jeremy Galindo, and Andrew Miller. They are currently signed to Magic Bullet Records.

The band formed in 2005 and released the EP which was originally supposed to be the band&amp;#039;s demo, Young Mountain, the same year. The EP received favorable reviews. They released their self-titled debut album on January 29, 2008.

The EP Young Mountain was initially released with 250 copies. After the band gained a significant fan base they released more copies.

